import './App.css';
import Navbar from './components/Navbar';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import Home from './components/pages/Home'

function App() {
  return (
    <>
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route path='/' exact component={Home}/>
        <Home/>
      </Routes>

      </BrowserRouter>
    <h1>LOL</h1>

    </>


  );
}

export default App;
